import React from 'react';

const Projects = () => {
    return (
        <section className='section__project'>
            <div className='container container__project'>
                <div>
                    <h2>My project</h2>
                    <p>This is my project </p>
                </div>
                <div className='project__cards'>
                    <div>Project One</div>
                    <div>Project Two</div>
                    <div>Project three</div>
                </div>
            </div>
        </section>
    );
};

export default Projects;
